import React, { useState } from 'react';

const Menu = () => {
    const [submenuVisible, setSubmenuVisible] = useState(false);

    const toggleSubmenu = (e) => {
        setSubmenuVisible(!submenuVisible);
        e.stopPropagation();

    };

    const [submenuVisible2, setSubmenuVisible2] = useState(false);

    const toggleSubmenu2 = (e) => {
        e.stopPropagation();

        setSubmenuVisible2(!submenuVisible2);
    };
/*
    return (
        <body class="bg-menu">
            <div class="container">
                <nav class="menu-lateral">
                    <ul>
                        <li class="item-menu" onClick={toggleSubmenu}>
                            Dashboard
                            {submenuVisible && (
                                <ul class="submenu">
                                   <li class="item-menu" onClick={toggleSubmenu2}>Dashboard 1.1</li>
                                    {submenuVisible2 && (
                                    <ul class="submenu">
                                        <li>Subitem1.1.1</li>
                                    </ul>
                                    )}
                                </ul>
                            )}
                        </li>
                    </ul>
                </nav>
            </div>
        </body>
    );*/

    return(
        <div class="menu-lateral">
        <ul>
          <li class="item-menu">
            <a href="#">Menú 1</a>
            <ul class="submenu">
              <li class="subitem">
                <a href="#">Submenú 1.1</a>
                <ul class="submenu2">
                  <li ><a href="#">Submenú 1.1.1</a></li>
                  <li><a href="#">Submenú 1.1.2</a></li>
                </ul>
              </li>
              <li class="subitem"><a href="#">Submenú 1.2</a></li>
            </ul>
          </li>
          
          <li class="item-menu">
            <a href="#">Menú 2</a>
            <ul class="submenu">
              <li><a href="#">Submenú 2.1</a></li>
              <li><a href="#">Submenú 2.2</a></li>
            </ul>
          </li>
        </ul>
      </div>
        
    );
};

export default Menu;
